import React from 'react';
import Header from './components/Header/Header';
import {Router,Link,Route,Switch} from 'react-router-dom';
function App() {
  return (
        <div className="App">
        <Header>
          NAVBAR

        </Header>

        <Route path='/'>
         HOME PAGE 
        </Route>

        <Route path='/product'>
          PRODUCT PAGE 
        </Route>

        <Route path='/company'>
          COMPANY PAGE
        </Route>
    </div>
  );
}

export default App;
